import Card from 'react-bootstrap/Card';
import Tours from '../Tours';


function Tour(props) {
    console.log(props);
    return (

        <>
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src={props.tour.i} />
                <Card.Body>
                    <Card.Title>{props.tour}</Card.Title>

                    <Card.Text>

                    </Card.Text>

                </Card.Body>
            </Card>
        </>
    )
}

export default Tour;
